import {
  Typography,
  AppBar,
  container,
  Grid,
  Grow,
  Container,
} from "@material-ui/core";
import "./App.css";
import memories from "./images/memories.jpg";

function App() {
  return (
    <div className="">
      <Container maxWidth="lg">
        <AppBar position="static" color="inherit" /> 
        <Typography variant="h2" align="center">
          Memories
        </Typography>
        <img src={memories} alt="memories" height="100" />

      </Container>
    </div>
  );
}

export default App;
